import './App.css';
import React, { useState } from 'react';


function App() {
  const [nom,setNom]=useState('bob')

  const modifNom=(e)=>{
    e.preventDefault()
    const nom='Patrice'
    setNom(nom)

  }

  return (
    <div className="App">
      <p>{nom}</p>
      <button onClick={modifNom}>Changer</button>
      <div>
        <input />
      </div>
    </div>
  );
}

export default App;
